class Solution:
    def longestOnes(self, nums, k: int) -> int:
        A1 = []
        counter = [0,0]
        for i in range(len(nums)):
            counter[nums[i]] += 1
            if i == len(nums)-1 or nums[i]==1 and nums[i+1]==0:
                A1.append(counter)
                counter = [0,0]
        # print(A1)
        max = 0
        i = 0
        j = 0
        ones = 0
        while j<len(nums):
            j+=1

            while k < A1[j-1][0] and i<j:
                k+=A1[i][0]
                ones -= A1[i][0]+A1[i][1]
                i+=1

            addright = 0
            if k>= A1[j-1][0]:
                k-=A1[j-1][0]
                ones += A1[j-1][0]+A1[j-1][1]
                if j<len(A1):
                    addright = min(A1[j][0], k)
            else:
                addright = min(A1[j-1][0],k)
                
            addleft = 0
            checkSum = ones 
            if i>0:
                checkSum += A1[i-1][1] 
                addleft = min(A1[i-1][0], k)
            if  checkSum+addleft > max:
                max =  checkSum+addleft
            if  checkSum+addright > max:
                max =  checkSum+addright
        return max


